jemy, że w dniach 21.01.2025-25.01.2025 w budynku będą prowadzone prace związane z remontem/modernizacją windy.\r\n\r\nW związku z tym winda będzie nieczynna \r\n\r\nProsimy o uwzględnienie utrudnień i korzystanie w tym czasie ze schodów.\r\nPrzepraszamy za niedogodności i dziękujemy za wyrozumiałość.\r\n\r\nZarząd Wspólnoty \r\nKontakt: 666777888\r\nData wywieszenia: 17.01.2025\r\n\r\n(Opcjonalnie dopisek)\r\nW razie pytań lub potrzeby pomocy (np. osoby starsze, z wózkami) prosimy o kontakt z administracją.<br/> Data wygaśnięcia: 2026-04-16 19:18:00<br/> Priorytet: 2<br/> Ostatnia edycja: 2026-01-16 19:44:55','Tytuł: REMONT WINDY<br/> Treść: Szanowni Państwo,\r\ninformujemy, że w dniach 21.01.2025-25.01.2025 w budynku będą prowadzone prace związane z remontem/modernizacją windy.\r\n\r\nW związku z tym winda będzie nieczynna \r\n\r\nProsimy o uwzględnienie utrudnień i korzystanie w tym czasie ze schodów.\r\nPrzepraszamy za niedogodności i dziękujemy za wyrozumiałość.\r\n\r\nZarząd Wspólnoty \r\nKontakt: 666777888\r\nData wywieszenia: 17.01.2025\r\n\r\n(Opcjonalnie dopisek)\r\nW razie pytań lub potrzeby pomocy (np. osoby starsze, z wózkami) prosimy o kontakt z administracją.<br/> Data wygaśnięcia: 2026-04-17 19:18<br/> Priorytet: 2<br/> Ostatnia edycja: 2026-01-16 19:45:34',1,'Edyctowano ogłoszenie'),(861,1,'2026-01-16 18:45:49',5,'announcements','Tytuł: Jak to jest być skrybą, dobrze?<br/> Treść: <br/>A, wie pan, moim zdaniem to nie ma tak, że dobrze, albo że niedobrze.\r\nGdybym miał powiedzieć, co cenię w życiu najbardziej, powiedziałbym, że ludzi.\r\nLudzi, którzy podali mi pomocną dłoń, kiedy sobie nie radziłem, kiedy byłem sam,\r\ni co ciekawe, to właśnie przypadkowe spotkania wpływają na nasze życie.\r\nChodzi o to, że kiedy wyznaje się pewne wartości, nawet pozornie uniwersalne,\r\nbywa, że nie znajduje się zrozumienia, które by tak rzec, które pomaga się nam rozwijać.\r\nJa miałem szczęście, by tak rzec, ponieważ je znalazłem, i dziękuję życiu!\r\nDziękuję mu; życie to śpiew, życie to taniec, życie to miłość!\r\nWielu ludzi pyta mnie o to samo: ale jak ty to robisz, skąd czerpiesz tę radość? A ja odpowiadam, że to proste!\r\nTo umiłowanie życia. To właśnie ono sprawia, że dzisiaj na przykład buduję maszyny, a jutro – kto wie? Dlaczego by nie – oddam się pracy społecznej i będę, ot, choćby, sadzić... doć— m-marchew...<br/> Data wygaśnięcia: 0000-00-00 00:00:00<br/> Priorytet: 1<br/> Ostatnia edycja: 2024-05-19 17:00:48','Tytuł: Jak to jest być skrybą, dobrze?<br/> Treść: <br/>A, wie pan, moim zdaniem to nie ma tak, że dobrze, albo że niedobrze.\r\nGdybym miał powiedzieć, co cenię w życiu najbardziej, powiedziałbym, że ludzi.\r\nLudzi, którzy podali mi pomocną dłoń, kiedy sobie nie radziłem, kiedy byłem sam,\r\ni co ciekawe, to właśnie przypadkowe spotkania wpływają na nasze życie.\r\nChodzi o to, że kiedy wyznaje się pewne wartości, nawet pozornie uniwersalne,\r\nbywa, że nie znajduje się zrozumienia, które by tak rzec, które pomaga się nam rozwijać.\r\nJa miałem szczęście, by tak rzec, ponieważ je znalazłem, i dziękuję życiu!\r\nDziękuję mu; życie to śpiew, życie to taniec, życie to miłość!\r\nWielu ludzi pyta mnie o to samo: ale jak ty to robisz, skąd czerpiesz tę radość? A ja odpowiadam, że to proste!\r\nTo umiłowanie życia. To właśnie ono sprawia, że dzisiaj na przykład buduję maszyny, a jutro – kto wie? Dlaczego by nie – oddam się pracy społecznej i będę, ot, choćby, sadzić... doć— m-marchew...<br/> Data wygaśnięcia: 2026-01-08 19:45<br/> Priorytet: 1<br/> Ostatnia edycja: 2026-01-16 19:45:49',1,'Edyctowano ogłoszenie');
